import { getUrl } from "../apis/api";
import React, { useState } from "react";





const RedirectPage =  () => {

    const [longUrl, setLongUrl] = useState("");


    const getLink = async (stringUrl) => {
        var vlongUrl= await getUrl({stringUrl});
        // console.log(await getUrl({long}));
        if(vlongUrl){
            setLongUrl(vlongUrl);
        }
    };


    var stringUrl= window.location.pathname ;
    if(stringUrl.length!==0){
        stringUrl = stringUrl.substring(1);
    }

    getLink(stringUrl);

    if(longUrl=== "NOT FOUND"){
        window.location.href='https:'
    }


    var targetUrl = 'https://';
    targetUrl = targetUrl + longUrl;
    // window.location.href=targetUrl;
    // window.location.href='https://www.google.com';
    // // return null;



    return (
        <h5>Redirect to {targetUrl}</h5>
    );

}

export default RedirectPage;
